import Layout from "../components/MyLayout";
import TopFiles from "../components/TopFiles";

export default function Index() {
  return (
    <div>
      <div className="landingHeader">
        <img
          className="guc"
          alt="logo"
          title="dumpTRUCK"
          src="/dumpTRUCKlogo.svg"
        />
        <hr />
      </div>

      <TopFiles />

      <style jsx>{`
        .guc {
          width: 13%;
          padding-left: 20px;
          padding-top: 20px;
          padding-bottom: 2px;
        }
        .landingHeader hr {
          width: 96%;
        }
      `}</style>
    </div>
  );
}
